"use strict";(self.webpackChunkdocusaurus=self.webpackChunkdocusaurus||[]).push([[8967],{94987:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"features/change-default-fonts","metadata":{"permalink":"/site/zh-CN/blog/features/change-default-fonts","source":"@site/blog/2023-12-03-change-default-fonts/index.mdx","title":"Change Default Fonts","description":"Default fonts are now changed to:","date":"2023-12-03T00:00:00.000Z","formattedDate":"2023\u5e7412\u67083\u65e5","tags":[{"label":"font","permalink":"/site/zh-CN/blog/tags/font"}],"hasTruncateMarker":false,"authors":[{"name":"Shangjin Tang","title":"Full Stack Developer","imageURL":"https://www.szdev.com/blog/images/avatar.jpg","key":"sol"}],"frontMatter":{"authors":["sol"],"slug":"features/change-default-fonts","title":"Change Default Fonts","tags":["font"]},"unlisted":false,"nextItem":{"title":"Interactive Map with Leaflet","permalink":"/site/zh-CN/blog/features/interactive-map-with-leaflet"}},"content":"Default fonts are now changed to:\\n\\n- `Optimistic Display` (for normal text)\\n- `Source Code Pro` (for monospaced text)"},{"id":"features/interactive-map-with-leaflet","metadata":{"permalink":"/site/zh-CN/blog/features/interactive-map-with-leaflet","source":"@site/blog/2023-11-29-interactive-map-with-leaflet/index.mdx","title":"Interactive Map with Leaflet","description":"Leaflet is the leading open-source JavaScript library for mobile-friendly interactive maps.","date":"2023-11-29T00:00:00.000Z","formattedDate":"2023\u5e7411\u670829\u65e5","tags":[{"label":"map","permalink":"/site/zh-CN/blog/tags/map"},{"label":"leaflet","permalink":"/site/zh-CN/blog/tags/leaflet"}],"hasTruncateMarker":true,"authors":[{"name":"Shangjin Tang","title":"Full Stack Developer","imageURL":"https://www.szdev.com/blog/images/avatar.jpg","key":"sol"}],"frontMatter":{"authors":["sol"],"slug":"features/interactive-map-with-leaflet","title":"Interactive Map with Leaflet","tags":["map","leaflet"]},"unlisted":false,"prevItem":{"title":"Change Default Fonts","permalink":"/site/zh-CN/blog/features/change-default-fonts"},"nextItem":{"title":"Support TensorFlow.js","permalink":"/site/zh-CN/blog/features/support-tensorflow-js"}},"content":"[**Leaflet**](https://leafletjs.com/) is the leading open-source JavaScript library for mobile-friendly interactive maps.\\n\\nWe\'ll draw a interactive map with **Leaflet**.\\n\\n\x3c!-- truncate --\x3e\\n\\nimport React, { useEffect, useRef } from \'react\';\\n\\nexport const MyLeafletMap = ({position}) => {\\n  const mapRef = useRef(null);\\n\\n  useEffect(() => {\\n    const link = document.createElement(\'link\');\\n    link.rel = \'stylesheet\';\\n    link.href = \'https://unpkg.com/leaflet@1.9.3/dist/leaflet.css\';\\n    link.integrity = \'sha256-kLaT2GOSpHechhsozzB+flnD+zUyjE2LlfWPgU04xyI=\';\\n    link.crossOrigin = \'\';\\n    const head = document.head || document.getElementsByTagName(\'head\')[0];\\n    head.appendChild(link);\\n\\n    const L = require(\'leaflet\');\\n    const map = L.map(mapRef.current).setView(position, 13);\\n\\n    L.tileLayer(\'https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png\', {\\n        attribution: \'&copy; <a href=\\"https://www.openstreetmap.org/copyright\\">OpenStreetMap</a> contributors\',\\n    }).addTo(map);\\n\\n    const marker = L.marker(position).addTo(map);\\n    marker.bindPopup(\'A pretty CSS3 popup.<br>Easily customizable.\').openPopup();\\n\\n    map.dragging.enable();\\n  }, []);\\n\\n  return <div id=\\"map\\" style={{aspectRatio: \'16/9\'}} ref={mapRef}></div>\\n}\\n\\n<MyLeafletMap position={[31.23, 121.47]}></MyLeafletMap>"},{"id":"features/support-tensorflow-js","metadata":{"permalink":"/site/zh-CN/blog/features/support-tensorflow-js","source":"@site/blog/2023-11-28-support-tensorflow-js/index.mdx","title":"Support TensorFlow.js","description":"We even support TensorFlow.js in MDX with React.","date":"2023-11-28T00:00:00.000Z","formattedDate":"2023\u5e7411\u670828\u65e5","tags":[{"label":"mdx","permalink":"/site/zh-CN/blog/tags/mdx"},{"label":"tensorflow","permalink":"/site/zh-CN/blog/tags/tensorflow"},{"label":"tensorflow-js","permalink":"/site/zh-CN/blog/tags/tensorflow-js"}],"hasTruncateMarker":true,"authors":[{"name":"Shangjin Tang","title":"Full Stack Developer","imageURL":"https://www.szdev.com/blog/images/avatar.jpg","key":"sol"}],"frontMatter":{"authors":["sol"],"slug":"features/support-tensorflow-js","title":"Support TensorFlow.js","tags":["mdx","tensorflow","tensorflow-js"]},"unlisted":false,"prevItem":{"title":"Interactive Map with Leaflet","permalink":"/site/zh-CN/blog/features/interactive-map-with-leaflet"},"nextItem":{"title":"Support Mermaid Diagrams","permalink":"/site/zh-CN/blog/features/support-mermaid-diagrams"}},"content":"We even support **TensorFlow.js** in **MDX** with **React**.\\n\\n\x3c!-- truncate --\x3e\\n\\nimport BrowserWindow from \'@site/src/components/BrowserWindow\';\\n\\nimport * as tf from \'@tensorflow/tfjs\';\\nimport {useEffect, useState} from \'react\';\\n\\nexport const Predict = ({xsData, ysData, input}) => {\\n  const [prediction, setPrediction] = useState(\'Loading...\');\\n  useEffect(() => {\\n    const runPrediction = async () => {\\n      const model = tf.sequential();\\n      model.add(tf.layers.dense({units: 1, inputShape: [1]}));\\n      model.compile({loss: \'meanSquaredError\', optimizer: \'sgd\'});\\n      // Reshape data to 2D for training.\\n      const xs = tf.tensor2d(xsData, [xsData.length, 1]);\\n      const ys = tf.tensor2d(ysData, [ysData.length, 1]);\\n      // Train the model using the data.\\n      await model.fit(xs, ys, {\\n        epochs: 10,\\n        callbacks: {\\n          onEpochEnd: (epoch, log) => console.log(`Epoch ${epoch}: loss = ${log.loss}`),\\n        },\\n      });\\n      // Use the model to do inference on the provided input.\\n      const result = model.predict(tf.tensor2d([input], [1, 1]));\\n      const predictionValue = result.dataSync()[0];\\n      setPrediction(predictionValue);\\n    };\\n    runPrediction();\\n  }, []); // passing an empty array as the dependency to only trigger once in lifecycle\\n  return prediction !== undefined ? prediction : \'Loading...\';\\n};\\n\\nTraining Data:\\n\\n- xs = [1, 3, 6, 10, 15]\\n- ys = [1, 5, 11, 19, 29]\\n\\nInference result for data 8:\\n\\n- <Highlight color=\\"#1877F2\\">\\n    {\' \'}\\n    <Predict xsData={[1, 3, 6, 10, 15]} ysData={[1, 5, 11, 19, 29]} input={8}></Predict>{\' \'}\\n  </Highlight>\\n\\n:::tip\\n\\n- Use inspection tool to see logs of training, such as `F12` in Chrome.\\n- Refresh the page to see different inference result.\\n\\n:::\\n\\n## React Function Definition\\n\\n```mdx-code-block\\n<BrowserWindow>\\n```\\n\\n```jsx\\nimport * as tf from \'@tensorflow/tfjs\';\\nimport {useEffect, useState} from \'react\';\\n\\nexport const Predict = ({xsData, ysData, input}) => {\\n  const [prediction, setPrediction] = useState(\'Loading...\');\\n  useEffect(() => {\\n    const runPrediction = async () => {\\n      const model = tf.sequential();\\n      model.add(tf.layers.dense({units: 1, inputShape: [1]}));\\n      model.compile({loss: \'meanSquaredError\', optimizer: \'sgd\'});\\n      // Reshape data to 2D for training.\\n      const xs = tf.tensor2d(xsData, [xsData.length, 1]);\\n      const ys = tf.tensor2d(ysData, [ysData.length, 1]);\\n      // Train the model using the data.\\n      await model.fit(xs, ys, {\\n        epochs: 10,\\n        callbacks: {\\n          onEpochEnd: (epoch, log) => console.log(`Epoch ${epoch}: loss = ${log.loss}`),\\n        },\\n      });\\n      // Use the model to do inference on the provided input.\\n      const result = model.predict(tf.tensor2d([input], [1, 1]));\\n      const predictionValue = result.dataSync()[0];\\n      setPrediction(predictionValue);\\n    };\\n    runPrediction();\\n  }, []); // passing an empty array as the dependency to only trigger once in lifecycle\\n  return prediction !== undefined ? prediction : \'Loading...\';\\n};\\n```\\n\\n```mdx-code-block\\n</BrowserWindow>\\n```\\n\\n## React Function Usage\\n\\n```mdx-code-block\\n<BrowserWindow>\\n```\\n\\n```jsx\\n<Predict xsData={[1, 3, 6, 10, 15]} ysData={[1, 5, 11, 19, 29]} input={8}></Predict>\\n```\\n\\n```mdx-code-block\\n</BrowserWindow>\\n```"},{"id":"features/support-mermaid-diagrams","metadata":{"permalink":"/site/zh-CN/blog/features/support-mermaid-diagrams","source":"@site/blog/2023-11-27-support-mermaid-diagrams/index.md","title":"Support Mermaid Diagrams","description":"Mermaid is a diagramming and charting tool.","date":"2023-11-27T00:00:00.000Z","formattedDate":"2023\u5e7411\u670827\u65e5","tags":[{"label":"mdx","permalink":"/site/zh-CN/blog/tags/mdx"},{"label":"mermaid","permalink":"/site/zh-CN/blog/tags/mermaid"},{"label":"diagram","permalink":"/site/zh-CN/blog/tags/diagram"}],"hasTruncateMarker":true,"authors":[{"name":"Shangjin Tang","title":"Full Stack Developer","imageURL":"https://www.szdev.com/blog/images/avatar.jpg","key":"sol"}],"frontMatter":{"authors":["sol"],"slug":"features/support-mermaid-diagrams","title":"Support Mermaid Diagrams","tags":["mdx","mermaid","diagram"]},"unlisted":false,"prevItem":{"title":"Support TensorFlow.js","permalink":"/site/zh-CN/blog/features/support-tensorflow-js"},"nextItem":{"title":"Support Global Tabs TabItem","permalink":"/site/zh-CN/blog/features/support-global-tabs-tabitem"}},"content":"Mermaid is a diagramming and charting tool.\\n\\nSee [Mermaid Tutorials](https://mermaid.js.org/config/Tutorials.html) and play with [Mermaid Live Editor](https://mermaid.live/).\\n\\n\x3c!-- truncate --\x3e\\n\\n## Sequence Diagram\\n\\n````md title=\\"Example Mermaid sequence diagram\\"\\n```mermaid\\ngraph TD;\\n    A--\x3eB;\\n    A--\x3eC;\\n    B--\x3eD;\\n    C--\x3eD;\\n```\\n````\\n\\n```mermaid\\nsequenceDiagram\\n    Alice->>+John: Hello John, how are you?\\n    Alice->>+John: John, can you hear me?\\n    John--\x3e>-Alice: Hi Alice, I can hear you!\\n    John--\x3e>-Alice: I feel great!\\n```\\n\\n## FlowChart\\n\\n````md title=\\"Example Mermaid flowchart\\"\\n```mermaid\\nflowchart TD\\n    A[Christmas] --\x3e|Get money| B(Go shopping)\\n    B --\x3e C{Let me think}\\n    C --\x3e|One| D[Laptop]\\n    C --\x3e|Two| E[iPhone]\\n    C --\x3e|Three| F[fa:fa-car Car]\\n```\\n````\\n\\n```mermaid\\nflowchart TD\\n    A[Christmas] --\x3e|Get money| B(Go shopping)\\n    B --\x3e C{Let me think}\\n    C --\x3e|One| D[Laptop]\\n    C --\x3e|Two| E[iPhone]\\n    C --\x3e|Three| F[fa:fa-car Car]\\n```"},{"id":"features/support-global-tabs-tabitem","metadata":{"permalink":"/site/zh-CN/blog/features/support-global-tabs-tabitem","source":"@site/blog/2023-11-26-support-global-tabs-tabitem/index.md","title":"Support Global Tabs TabItem","description":"Docusaurus provides the `` component that you can use in Markdown thanks to MDX:","date":"2023-11-26T00:00:00.000Z","formattedDate":"2023\u5e7411\u670826\u65e5","tags":[{"label":"mdx","permalink":"/site/zh-CN/blog/tags/mdx"},{"label":"tabs","permalink":"/site/zh-CN/blog/tags/tabs"},{"label":"tabitem","permalink":"/site/zh-CN/blog/tags/tabitem"}],"hasTruncateMarker":false,"authors":[{"name":"Shangjin Tang","title":"Full Stack Developer","imageURL":"https://www.szdev.com/blog/images/avatar.jpg","key":"sol"}],"frontMatter":{"authors":["sol"],"slug":"features/support-global-tabs-tabitem","title":"Support Global Tabs TabItem","tags":["mdx","tabs","tabitem"]},"unlisted":false,"prevItem":{"title":"Support Mermaid Diagrams","permalink":"/site/zh-CN/blog/features/support-mermaid-diagrams"},"nextItem":{"title":"Support Math KaTeX","permalink":"/site/zh-CN/blog/features/support-math-katex"}},"content":"Docusaurus provides the `<Tabs>` component that you can use in Markdown thanks to MDX:\\n\\nWe configured it globally so it\'s a feature available from everywhere."},{"id":"features/support-math-katex","metadata":{"permalink":"/site/zh-CN/blog/features/support-math-katex","source":"@site/blog/2023-11-24-support-math-latex/index.md","title":"Support Math KaTeX","description":"Mathematical equations can be rendered using KaTeX.","date":"2023-11-24T00:00:00.000Z","formattedDate":"2023\u5e7411\u670824\u65e5","tags":[{"label":"math","permalink":"/site/zh-CN/blog/tags/math"},{"label":"tex","permalink":"/site/zh-CN/blog/tags/tex"},{"label":"katex","permalink":"/site/zh-CN/blog/tags/katex"}],"hasTruncateMarker":true,"authors":[{"name":"Shangjin Tang","title":"Full Stack Developer","imageURL":"https://www.szdev.com/blog/images/avatar.jpg","key":"sol"}],"frontMatter":{"authors":["sol"],"slug":"features/support-math-katex","title":"Support Math KaTeX","tags":["math","tex","katex"]},"unlisted":false,"prevItem":{"title":"Support Global Tabs TabItem","permalink":"/site/zh-CN/blog/features/support-global-tabs-tabitem"},"nextItem":{"title":"MDX Features","permalink":"/site/zh-CN/blog/features/mdx-features"}},"content":"Mathematical equations can be rendered using [KaTeX](https://katex.org).\\n\\nThis document only shows usage. for installation, see [Docusaurus - Math Equations](https://docusaurus.io/docs/markdown-features/math-equations).\\n\\n\x3c!--truncate--\x3e\\n\\n## Usage {#usage}\\n\\nPlease read [KaTeX](https://katex.org) documentation for more details.\\n\\n### Inline {#inline}\\n\\nWrite inline math equations by wrapping LaTeX equations between `$`:\\n\\n```latex\\nLet $f\\\\colon[a,b]\\\\to\\\\R$ be Riemann integrable. Let $F\\\\colon[a,b]\\\\to\\\\R$ be\\n$F(x)=\\\\int_{a}^{x} f(t)\\\\,dt$. Then $F$ is continuous, and at all $x$ such that\\n$f$ is continuous at $x$, $F$ is differentiable at $x$ with $F\'(x)=f(x)$.\\n```\\n\\nLet $f\\\\colon[a,b] \\\\to \\\\R$ be Riemann integrable. Let $F\\\\colon[a,b]\\\\to\\\\R$ be $F(x)=\\n\\\\int_{a}^{x} f(t)\\\\,dt$. Then $F$ is continuous, and at all $x$ such that $f$ is continuous at $x$, $F$ is differentiable at $x$ with $F\'(x)=f(x)$.\\n\\n### Blocks {#blocks}\\n\\nFor equation block or display mode, use line breaks and `$$`:\\n\\n```latex\\n$$\\nI = \\\\int_0^{2\\\\pi} \\\\sin(x)\\\\,dx\\n$$\\n```\\n\\n$$\\nI = \\\\int_0^{2\\\\pi} \\\\sin(x)\\\\,dx\\n$$"},{"id":"features/mdx-features","metadata":{"permalink":"/site/zh-CN/blog/features/mdx-features","source":"@site/blog/2023-11-23-mdx-usage/index.mdx","title":"MDX Features","description":"Blog posts support Docusaurus Markdown features, such as MDX.","date":"2023-11-23T00:00:00.000Z","formattedDate":"2023\u5e7411\u670823\u65e5","tags":[{"label":"mdx","permalink":"/site/zh-CN/blog/tags/mdx"}],"hasTruncateMarker":true,"authors":[{"name":"Shangjin Tang","title":"Full Stack Developer","imageURL":"https://www.szdev.com/blog/images/avatar.jpg","key":"sol"}],"frontMatter":{"authors":["sol"],"slug":"features/mdx-features","title":"MDX Features","tags":["mdx"]},"unlisted":false,"prevItem":{"title":"Support Math KaTeX","permalink":"/site/zh-CN/blog/features/support-math-katex"},"nextItem":{"title":"Welcome","permalink":"/site/zh-CN/blog/welcome"}},"content":"Blog posts support [Docusaurus Markdown features](https://docusaurus.io/docs/markdown-features), such as [MDX](https://mdxjs.com/).\\n\\n\x3c!--truncate--\x3e\\n\\n## Interactive\\n\\n:::tip\\n\\nUse the power of React to create interactive blog posts.\\n\\n```js\\n<button onClick={() => alert(\'button clicked!\')}>Click me!</button>\\n```\\n\\n<button onClick={() => alert(\'button clicked!\')}>Click me!</button>\\n\\n:::\\n\\n## Diagram\\n\\n:::tip\\n\\nUse the power of React to create diagrams.\\n\\n```mdx\\nimport {Chart} from \'./_asset/snowfall.js\';\\nexport const year = 2013;\\n\\n# Last year\u2019s snowfall\\n\\nIn {year}, the snowfall was above average. It was followed by a warm spring which caused flood conditions in many of the nearby rivers.\\n\\n<Chart year={year} color=\\"#fcb32c\\" />;\\n```\\n\\nimport {Chart} from \'./_asset/snowfall.js\';\\nexport const year = 2013;\\n\\n<h1>Last year\'s snowfall</h1>\\n<p>\\n  In {year}, the snowfall was above average. It was followed by a warm spring which caused flood conditions in many of\\n  the nearby rivers.\\n</p>\\n<Chart year={year} color=\\"#fcb32c\\" />\\n\\n:::"},{"id":"welcome","metadata":{"permalink":"/site/zh-CN/blog/welcome","source":"@site/blog/2019-05-28-welcome/index.md","title":"Welcome","description":"Docusaurus blogging features are powered by the blog plugin.","date":"2019-05-28T00:00:00.000Z","formattedDate":"2019\u5e745\u670828\u65e5","tags":[{"label":"docusaurus","permalink":"/site/zh-CN/blog/tags/docusaurus"}],"hasTruncateMarker":true,"authors":[{"name":"Shangjin Tang","title":"Full Stack Developer","imageURL":"https://www.szdev.com/blog/images/avatar.jpg","key":"sol"}],"frontMatter":{"slug":"welcome","title":"Welcome","authors":["sol"],"tags":["docusaurus"]},"unlisted":false,"prevItem":{"title":"MDX Features","permalink":"/site/zh-CN/blog/features/mdx-features"}},"content":"[Docusaurus blogging features](https://docusaurus.io/docs/blog) are powered by the [blog plugin](https://docusaurus.io/docs/api/plugins/@docusaurus/plugin-content-blog).\\n\\nUse a `\x3c!--` `truncate` `--\x3e` comment to limit blog post size in the list view.\\n\\n\x3c!--truncate--\x3e\\n\\nSimply add Markdown files (or folders) to the `blog` directory.\\n\\nRegular blog authors can be added to `authors.yml`.\\n\\nThe blog post date can be extracted from filenames, such as:\\n\\n- `2019-05-30-welcome.md`\\n- `2019-05-30-welcome/index.md`\\n\\nA blog post folder can be convenient to co-locate blog post images:\\n\\n![Docusaurus Plushie](./docusaurus-plushie-banner.jpeg)\\n\\nThe blog supports tags as well!\\n\\n**And if you don\'t want a blog**: just delete this directory, and use `blog: false` in your Docusaurus config."}]}')}}]);